import axios from 'axios';

const BASE_URL = "http://localhost:8080";

export const getCars = () => axios.get(`${BASE_URL}/cars`);
export const addCar = (brand, engineType) => axios.post(`${BASE_URL}/add`, null, {
  params: { brand, engineType }
});
export const rentCar = (id) => axios.put(`${BASE_URL}/rent/${id}`);
export const suggestCars = () => axios.get(`${BASE_URL}/suggest`);
